        <>
            <LogoTop />
            <div className='py-5 text-center'>
                <h2>Rooms</h2>
            </div>
            <div class="container mx-auto">
  <div class="grid grid-cols-4 gap-6">
    <div>1</div>
    <div>2</div>
    <div>3</div>
    <div>4</div>
  </div>
</div>
            <div className='grid-cols-3 '>
                <CardRoom />
                <CardRoom />
                <CardRoom />
            </div>
        </>

    );

};
